import React from 'react';

const Dropdown = ({ items, handleItemClick }) => {
  return (
    <ul className="dropdown-content">
      {items.map((item, index) => (
        <li key={index}>
          <a href={item.link} className="link--text focus-inset caption-large" onClick={() => handleItemClick(item)}>
            {item.label}
          </a>
        </li>
      ))}
    </ul>
  );
};

export default Dropdown;





